import React from 'react'

var minPriceTracker = 0;
var maxPriceTracker = 0;

var [state, setState] = useState();

this.state = {
  minPriceTracker: 0,
  maxPriceTracker: 0
};

function isNullOrEmpty(stringInput) {
  if (stringInput === null || stringInput.toString().trim() === "") {
    return true;
  } else {
    return false;
  }
}

function checkIfMinPriceNegative(event) {
  var numInput = event.target.value;
  console.log(numInput);
  if (numInput < 0) {
    event.target.value = 0;
  }
  this.setState({minPriceTracker: event.target.value})
}

function checkIfMaxPriceNegative(event) {
  var numInput = event.target.value;
  console.log(numInput);
  if (numInput < 0) {
    event.target.value = 0;
  }
  this.setState({maxPriceTracker: event.target.value})
}

function search() {
  return (
    <div>
      <h1> Search </h1>

      <form id="search-form" method="POST">
        <label htmlFor="address">Address</label>
        <input name="address" id="address" placeholder="Address" type="text" />
        <label htmlFor="min_price">Minimum Price</label>
        <input name="min_price" id="min_price" placeholder="Minimum price" type="number" onBlur={checkIfMinPriceNegative} />
        <label htmlFor="max_price">Maximum Price</label>
        <input name="max_price" id="max_price" placeholder="Minimum price" type="number" onBlur={checkIfMaxPriceNegative} />
        <label htmlFor="numBedrooms"># of Bedrooms</label>
        <select id="numBedrooms" name="numBedrooms">
            <option value="" selected disabled>Select Beds</option>
            <option value="noselection">No Selection</option>
            <option value="1">1 Bed</option>
            <option value="2">2 Beds</option>
            <option value="3">3 Beds</option>
            <option value="4">4 Beds</option>
            <option value="5">5 Beds</option>
        </select>
        <label htmlFor="numBathrooms"># of Bathrooms</label>
        <select id="numBathrooms" name="numBathrooms">
            <option value="" selected disabled>Select Beds</option>
            <option value="noselection">No Selection</option>
            <option value="1">1 Bed</option>
            <option value="2">2 Beds</option>
            <option value="3">3 Beds</option>
            <option value="4">4 Beds</option>
            <option value="5">5 Beds</option>
        </select>
        <div id="errorMessage" />
        <button type="submit" disabled = {this.state.minPriceTracker > this.state.maxPriceTracker}> Search </button>
      </form>
    </div>
  )
}

export default search
